        function getRandomColor(seed) {
            var M = 397;
            var MT = new Array(624);
            var state = seed !== undefined ? seed : Math.floor(Math.random() * 1000000);

            function initializeGenerator(seed) {
                MT[0] = seed >>> 0;
                for (var i = 1; i < 624; i++) {
                    MT[i] = (1812433253 * (MT[i - 1] ^ (MT[i - 1] >>> 30)) + i) >>> 0;
                }
            }

            function extractNumber() {
                if (state >= 624) {
                    twist();
                }

                var y = MT[state];
                y ^= y >>> 11;
                y ^= (y << 7) & 0x9d2c5680;
                y ^= (y << 15) & 0xefc60000;
                y ^= y >>> 18;

                state++;
                return y >>> 0;
            }

            function twist() {
                for (var i = 0; i < 624; i++) {
                    var y = (MT[i] & 0x80000000) + (MT[(i + 1) % 624] & 0x7fffffff);
                    MT[i] = MT[(i + M) % 624] ^ (y >>> 1);
                    if (y % 2 !== 0) {
                        MT[i] ^= 0x9908b0df;
                    }
                }
                state = 0;
            }

            initializeGenerator(state);

            var color = '#';
            for (var i = 0; i < 6; i++) {
                var randomNumber = extractNumber();
                var index = randomNumber % 16;
                color += '0123456789ABCDEF'.charAt(index);
            }

            return color;
        }

                    document.getElementById('c2').style.backgroundColor = colors[1][1];
                    document.getElementById('c3').style.backgroundColor = colors[2][1];
                    document.getElementById('c4').style.backgroundColor = colors[3][1];
                    document.getElementById('c5').style.backgroundColor = colors[4][1];
                }
                map.addLayer({
                    "id": "points",
                    "type": "circle",
                    "source": "unique",
                    "paint": {
                        "circle-color": {
                            "property": "count",
                            "type": "interval",
                            "stops": colors
                        },
                        'circle-radius': {
                            'base': 2,
                            'stops': [[6, 4], [9, 4], [11, 10], [12, 12], [16, 24]]
                        },
                        "circle-blur": 0.2
                    }
                });

                map.addLayer({
                    "id": "labels",
                    "type": "symbol",
                    "source": "unique",
                    "layout": {
                        "text-font": ["Ubuntu Light Bold"],
                        "text-field": ["get", "count"],
                        "text-size": {
                            'base': 4,
                            'stops': [[9, 6], [11, 11], [16, 18]]
                        },
                        "text-allow-overlap": true
                    },
                    "minzoom": 11,
                });

                map.on('click', 'points', function (e) {

                    new mapboxgl.Popup({closeOnClick: false, offset: {'bottom': [0, -10]}})
                        .setLngLat(e.features[0].geometry.coordinates)
                        .setHTML('<div style="background-color: #000000;"><b><a href=https://www.warded.se/turf/zones.php?zone=' + e.features[0].properties.title + '>' + e.features[0].properties.title + '</a> </div>')
                        .addTo(map);
                });


                // Change the cursor to a pointer when the mouse is over the places layer.
                map.on('mouseenter', 'points', function () {
                    map.getCanvas().style.cursor = 'pointer';
                });

                // Change it back to a pointer when it leaves.
                map.on('mouseleave', 'points', function () {
                    map.getCanvas().style.cursor = '';
                });

                map.addControl(new mapboxgl.FullscreenControl());
            });
        }
    </script>
